export default function BrandsWhoTrustUs() {
  const brands = [
    { name: "Tsu Cosméticos", logo: TSU },
    { name: "Clarín", logo: Clarin },
    { name: "Violetta Cosméticos", logo: Violetta },
    { name: "Avon Products", logo: Avon },
    { name: "Cervecería y Maltería Quilmes", logo: Quilmes },
    { name: "Gigot Cosméticos", logo: Gigot },
    { name: "Gestión Compartida", logo: GestionCompartida },
  ];

  return (
    <ul className="flex list-none flex-wrap justify-center gap-16 fill-primary md:gap-x-32">
      {brands.map(({ name, logo: Logo }, i) => (
        <li title={name} className="flex items-center" key={i}>
          <Logo className="w-64" />
          <span className="sr-only">{name}</span>
        </li>
      ))}
    </ul>
  );
}
